begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(27128406117959010)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'COM.ILAURENSSE.TAGSITEM'
,p_display_name=>'Tags Item'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS'
,p_javascript_file_urls=>'#PLUGIN_FILES#inputTags.jquery.min.js'
,p_css_file_urls=>'#PLUGIN_FILES#inputTags.min.css'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'PROCEDURE render_tags_item (',
'    p_item     IN apex_plugin.t_page_item,',
'    p_plugin   IN apex_plugin.t_plugin,',
'    p_param    IN apex_plugin.t_item_render_param,',
'    p_result   IN OUT NOCOPY apex_plugin.t_item_render_result',
')',
' IS',
'  l_read_only           p_param.is_readonly%type          := p_param.is_readonly;',
'  l_is_printer_friendly p_param.is_printer_friendly%type  := p_param.is_printer_friendly;',
'  l_item_max_length     p_item.element_max_length%type    := p_item.element_max_length;',
'  l_item_size           p_item.element_width%type         := p_item.element_width;',
'  l_item_name           varchar2(1000)                    := p_item.name;',
'  l_js_code             varchar2(4000);',
'  l_max_tags            p_item.attribute_01%type          := p_item.attribute_01;',
'  l_target_url          p_item.attribute_02%type          := p_item.attribute_02;',
'  l_tags_lov            p_item.attribute_03%type          := p_item.attribute_03;',
'  l_other_values        p_item.attribute_04%type          := p_item.attribute_04;',
'  l_editable            varchar2(5);',
'  l_restricted          varchar2(5);',
'  l_report_url          varchar2(4000);',
'  l_page_mode           varchar2(200);',
'',
'  l_column_value_list   apex_plugin_util.t_column_value_list;',
'begin',
' ',
'  if apex_application.g_debug ',
'  then',
'    apex_plugin_util.debug_page_item ( p_plugin                => p_plugin,',
'                                       p_page_item             => p_item,',
'                                       p_value                 => p_param.value,',
'                                       p_is_readonly           => l_read_only,',
'                                       p_is_printer_friendly   => l_is_printer_friendly);',
'  end if;',
'',
'  -- Is the current page a Modal Dialog or Normal page? ',
'  -- Needed for a proper redirect to a different page.',
'  select case',
'           when page_mode like ''Modal%'' then ''modal''',
'           else ''normal''',
'         end  ',
'  into l_page_mode',
'  from  apex_application_pages',
'  where application_id = :app_id',
'  and page_id = :app_page_id;',
'',
'  if l_read_only',
'  then',
'    l_editable := ''false'';',
'  else ',
'    l_editable := ''true'';',
'  end if;',
'',
'  if l_other_values = ''N''',
'   then',
'    l_restricted := ''true'';',
'  else',
'    l_restricted := ''false'';',
'  end if;',
'   ',
'  l_column_value_list :=',
'        apex_plugin_util.get_data (',
'            p_sql_statement    => l_tags_lov --p_item.lov_definition',
'           ,p_min_columns      => 1 --2',
'           ,p_max_columns      => 1 --2',
'           ,p_component_name   => p_item.name',
'            );',
'',
'  --Example of a tags LOV list:',
'  --l_tags_lov := ''[''''BAG'''', ''''WOMEN'''', ''''MEN'''', ''''ACCESSORY'''']'';',
'  if l_column_value_list(1).count > 0',
'  then',
'    l_tags_lov := ''['';',
'    for i in 1 .. l_column_value_list(1).count',
'    loop',
'      l_tags_lov := l_tags_lov || '''''''' || sys.htf.escape_sc(l_column_value_list(1)(i))|| '''''',''; -- return column',
'    end loop;',
'    l_tags_lov := rtrim(l_tags_lov) || '']'';',
'  end if;',
'',
'  sys.htp.prn(''<input type="text" id="''||l_item_name||''" name="''||l_item_name||''"" value="''||p_param.value||''">'');',
'',
'  l_js_code := ''$("#''||l_item_name||''").inputTags({ editable:'' || l_editable ||'',''',
'                                                 ||''destroy:'' || l_editable || '',''',
'                                                 ||''create:'' || l_editable ||'',''',
'                                                 ||''url:''''''|| l_target_url ||'''''',''',
'                                                 ||''max:''''''|| l_max_tags ||'''''',''',
'                                                 ||''pagemode:''''''|| l_page_mode ||'''''',''',
'                                                 ||''autocomplete: {values: ''||l_tags_lov||'', ''',
'                                                 ||''only: ''||l_restricted ||''}''',
'                                                 ||'' });'';                                                    ',
'  apex_javascript.add_onload_code (l_js_code);',
'    ',
' End render_tags_item;'))
,p_api_version=>2
,p_render_function=>'render_tags_item'
,p_standard_attributes=>'VISIBLE:READONLY:SOURCE:ELEMENT:WIDTH'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_version_identifier=>'1.0'
,p_files_version=>49
);
